import ControlBar from './ControlBar.js';

function OpeningFile() {
    return (
        <Draggable
            handle=".handle"
        >
            <div className="rounded-full p-10">
                <ControlBar/>
                <div className="bg-white text-black text-8xl border-x-2 border-b-2 border-slate-200 p-10">
                    Nicholas Angelici
                </div>
            </div>
        </Draggable>
    );
}

export default OpeningFile;
